import styles from '../../styles/scss/dashboard-home.module.scss';
import classnames from 'classnames';
import { useSelector, useDispatch } from 'react-redux';
import { setProfileImage } from '../../components/actions/profileImageActions';
import { setProfileName } from '../../components/actions/profileNameActions';
import DashboardMenu from '../../components/DashboardMenu';

const Dashboard = (/*props*/) => {
	const jwt = useSelector((state) => state.jwtToken);
	const currentProfileImage = useSelector((state) => state.profileImage);
	const state = useSelector((state) => state);
	console.log(state);

	// if (currentProfileImage === '') {
	// 	const dispatch = useDispatch();
	// 	dispatch(setProfileImage(props.profileImage));
	// 	dispatch(setProfileName(props.profileName));
	// }

	return (
		<main className={styles.dashboardContainer}>
			<div className={styles.dashboardMenuContainer}>
				<DashboardMenu />
			</div>
		</main>
	);
};

